	public boolean sendMail(String from, String emails, String subject,String bodyText ) {
		
		
		boolean sentSuccessfully = false;
		System.out.println("In Java Code");
		try{
			if(emails != null && !"".equals(emails.trim())) {
				if(emails.contains(",")) {
					String[] str = emails.split(",");
					for (int i=0;i<str.length;i++){
						Properties props = System.getProperties();
						props.put("mail.smtp.host", getHost());
						Session session = Session.getDefaultInstance(props,null);
						Message message =  new MimeMessage(session);
						message.setFrom(new InternetAddress(from));
						setTo(str[i]);
						message.setRecipient(Message.RecipientType.TO, to);
						setBody(bodyText);
						if(subject == null ||subject.length() == 0){
							message.setSubject("DB Info");
						}else{
							message.setSubject(subject);
						}
						message.setContent(getBody(),"text/html");
					//	message.setText(body);
						message.setSentDate(new Date());
						Transport.send(message);
						sentSuccessfully = true;
					}
				} else {
					Properties props = System.getProperties();
					props.put("mail.smtp.host", getHost());
					Session session = Session.getDefaultInstance(props,null);
					Message message =  new MimeMessage(session);
					message.setFrom(new InternetAddress(from));
					setTo(emails);
					message.setRecipient(Message.RecipientType.TO, to);
					setBody(bodyText);
					if(subject == null ||subject.length() == 0){
						message.setSubject("DB Info");
					}else{
						message.setSubject(subject);
					}
					message.setContent(getBody(),"text/html");
				//	message.setText(body);
					message.setSentDate(new Date());
					Transport.send(message);
					sentSuccessfully = true;
				}
			}
			
			
			
		}catch(Exception e){
			e.printStackTrace();
		}
		
		return sentSuccessfully;
	}

	/** Donnie : mail with attachment **/
	public boolean sendMailWithAtt(String from, String emails, String subject, String bodyText, String fileJason, String zipFlag) {

		boolean sentSuccessfully = false;

		boolean flag = Boolean.parseBoolean(zipFlag);
		try {
			JSONParser parser = new JSONParser();
			if (fileJason != null && !"".equals(fileJason)) {
				Object obj = parser.parse(fileJason);
				JSONArray array = (JSONArray) obj;
				if (emails != null && !"".equals(emails.trim())) {
					sentSuccessfully = generateMailWithAtt(sentSuccessfully, from, subject, bodyText, emails, array,
							flag);
				}
			} else {
				sendMail(from, emails, subject, bodyText);
			}
		} catch (ParseException e) {
			e.printStackTrace();
		} catch (FileNotFoundException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		}

		return sentSuccessfully;
	}

	public boolean generateMailWithAtt(boolean sentSuccessfully, String from, String subject, String bodyText,
			String emails, JSONArray array, boolean zipFlag) throws IOException {

		Properties props = System.getProperties();
		props.put("mail.smtp.host", getHost());
		Session session = Session.getDefaultInstance(props, null);
		Message message = new MimeMessage(session);
		try {
			message.setFrom(new InternetAddress(from));
			if (emails.contains(",")) {
				InternetAddress[] groups = InternetAddress.parse(emails);
				message.setRecipients(Message.RecipientType.TO, groups);
			} else {
				setTo(emails);
				message.setRecipient(Message.RecipientType.TO, to);
			}

			setBody(bodyText);
			if (subject == null || subject.length() == 0) {
				message.setSubject("DB Info");
			} else {
				message.setSubject(subject);
			}

			// Mail attachment
			Multipart mp = new MimeMultipart();
			MimeBodyPart mbp = new MimeBodyPart();
			mbp.setContent(getBody().toString(), "text/html;charset=gb2312");
			mp.addBodyPart(mbp);

			@SuppressWarnings("unchecked")
			Iterator<JSONObject> itr = array.iterator();
			if (!zipFlag) {
				while (itr.hasNext()) {
					JSONObject obj = itr.next();
					String filename = (String) obj.get("filename");
					System.err.print("filename ==================" + filename);
					String filecode = (String) obj.get("filecode");
					if (filename != null && filename != "") {
						mbp = new MimeBodyPart();
						// filename += ".\\";
						decodeFile(filecode, filename);
						FileDataSource fds = new FileDataSource(filename);
						mbp.setDataHandler(new DataHandler(fds));
						mbp.setFileName(filename);
						mp.addBodyPart(mbp);
						/* remove temp files */
						// file.removeAllElements();
					}

				}
			} else {
				String zipFile = "attachments.zip";
				// create byte buffer
				byte[] buffer = new byte[1024];
				// create object of FileOutputStream
				FileOutputStream fout = new FileOutputStream(zipFile);

				// create object of ZipOutputStream from FileOutputStream
				ZipOutputStream zout = new ZipOutputStream(fout);
				while (itr.hasNext()) {
					JSONObject obj = itr.next();
					String filename = (String) obj.get("filename");
					System.err.print("filename ==================" + filename);
					String filecode = (String) obj.get("filecode");
					if (filename != null && filename != "") {
						decodeFile(filecode, filename);
						FileInputStream fin = new FileInputStream(filename);
						zout.putNextEntry(new ZipEntry(filename));
						int length;

						while ((length = fin.read(buffer)) > 0) {
							zout.write(buffer, 0, length);
						}
						zout.closeEntry();

						// close the InputStream
						fin.close();
					}
				}
				zout.close();
				mbp = new MimeBodyPart();
				FileDataSource fds = new FileDataSource(zipFile);
				mbp.setDataHandler(new DataHandler(fds));
				mbp.setFileName(zipFile);
				mp.addBodyPart(mbp);
			}

			message.setContent(mp);
			message.setSentDate(new Date());
			Transport.send(message);
			sentSuccessfully = true;
		} catch (AddressException e) {
			e.printStackTrace();
		} catch (MessagingException e) {
			e.printStackTrace();
		}

		return sentSuccessfully;
	}

